import Head from 'next/head'
import Link from 'next/Link'
import fs from 'fs'

export default function Home({slugs}) {
  return (
    <div>
      <ul>
        {slugs.map( slug => {
          return(
          <li key={slug}>
            <Link key={slug} href={'/blog/'+slug}><a>{slug}</a></Link>
          </li>
          )
        })}
      </ul>
    </div>
  )
}

